PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS referensi (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  name TEXT,
  folder_id TEXT,
  file_id TEXT,
  download_url TEXT
);

-- Menghapus data dari tabel sqlite_sequence (jika diperlukan)
DELETE FROM sqlite_sequence;

-- Membuat indeks FTS pada kolom name
CREATE VIRTUAL TABLE IF NOT EXISTS referensi_fts USING fts5(name);

-- Menyisipkan data dari kolom name ke dalam indeks FTS

COMMIT;
